import React from 'react';

const Footer = () => {
  return (
    <footer className="bg-gray-800 text-white py-16">
      <div className="footer-wrapper container mx-auto flex justify-between items-center">
        <div className="footer-faded-text absolute left-0 bottom-0 text-gray-500 opacity-30">Footer</div>
        <div className="link-wrapper flex gap-8">
          <div><a href="#">Privacy Policy</a></div>
          <div><a href="#">Terms of Service</a></div>
          <div><a href="#">Contact</a></div>
        </div>
        <div className="icon-wrapper flex gap-4">
          <span className="text-xl">Facebook</span>
          <span className="text-xl">Twitter</span>
          <span className="text-xl">LinkedIn</span>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
